import CardSignIn from "./cardSignIn";
import Footer from "./footer";

function App() {
  return (
    <Router>
      <div className="app">
        <Switch>
          <Route path="/" exact component={App} />
          {/* <Route path="/home" component={Home} /> */}
        </Switch>
        <Nav />
        {/* <CopyBlock /> */}
        {/* <CardWidget /> */}
        <CardSignIn />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
